import classes from "./cources.module.css";
import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlus } from "@fortawesome/free-solid-svg-icons";
import { Link, Route, Switch } from "react-router-dom";
import { connect } from "react-redux";
import Table from "../table/table";
class Cources extends Component {
  render() {
    console.log("cources");
    return (
      <div className={classes.cource}>
        <div className={classes.buttons}>
          <div className={classes.New_edit}>
            <Link to="/add">
              <button className={classes.New}>
                <FontAwesomeIcon icon={faPlus} className={classes.fontAwsome} />
                New
              </button>
            </Link>
          </div>
          <div>
            <button className={classes.Edit}>
              <FontAwesomeIcon icon={faPlus} className={classes.fontAwsome} />
              Edit
            </button>
            <button className={classes.Delete}>
              <FontAwesomeIcon icon={faPlus} className={classes.fontAwsome} />
              Delete
            </button>
          </div>
        </div>
        <span className={classes.title}>Category</span>
        <hr />
        <div className={classes.table}>
          <div className={classes.heading}>Title</div>
          <div className={classes.heading}>Author</div>
          <div className={classes.heading}>Length</div>
          <div className={classes.heading}>category</div>
        </div>
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    data: state.data,
  };
};
export default connect(mapStateToProps)(Cources);
